section .data
  prompt db "Enter a number: ", 0
  even_msg db " is Even", 10, 0
  odd_msg db " is Odd", 10, 0
  
  section .bss
  number resb 4
  
  section .text
  global _start
  
  _start:
  ; Print prompt
  mov eax, 4
  mov ebx, 1
  mov ecx, prompt
  mov edx, 16
  int 0x80
  
  ; Read number
  mov eax, 3
  mov ebx, 0
  mov ecx, number
  mov edx, 4
  int 0x80
  
  ; Convert ASCII to integer
  mov eax, [number]
  sub eax, '0'
  
      ; Check if number is 1
  cmp eax, 1
  jne .not_1
  mov ecx, 1
  mov edx, odd_msg
  call print_result
  jmp .exit
